import os
string =''
stringd=''
for i in string:
    if i == 'T':
        stringd+='A'
    if i == 'A':
        stringd+='T'
    if i == 'C':
        stringd+='G'
    if i == 'G':
        stringd+='C'
print(stringd[::-1])
# Reversing the complemented string
stringd = stringd[::-1]

# File path for the text file on the desktop
desktop_path = os.path.join(os.path.join(os.environ['USERPROFILE']), 'Desktop')
file_path = os.path.join(desktop_path, 'result.txt')

# Writing the result to the text file
with open(file_path, 'w') as file:
    file.write(stringd)
print("bos 3ala el file fee :", file_path)